import React from 'react';

const Navbar = () => {
  return (
    <nav className="bg-red text-white p-4">
      <ul className="flex justify-between">
        <li>Add</li>
        <li>Update</li>
        <li>Delete</li>
      </ul>
    </nav>
  );
};

export default Navbar;
